  b 17.11.1996
  Joshua b. at Gisborne.
  04>'WILLIAMS, Leslie Edward
  b 20.10.1877 d 07.11.1905
  Leslie b. at Auckland and d. and bd. at Dunedin.
  Leslie was a lawyer. He was an accomplished musician and used to sing solo in the Cathedral choir in
  Dunedin.
  05> WILLIAMS, Henry Carleton m on 15.02.1911 to MILLS, Catherine Leslie
  b 18.08.1880 d 03.07.1961
  b 05.11.1885 d 31.05.1966
  Carleton b. at Auckland and m, at Napier. Leslie, d/o John Mills and Annie Burt. Leslie was
  cremated and her ashes are on Rerepe, the highest point on "Sherwood" station.
  The family moved to Dunedin in 1881/2 and Carl was educated at Otago Boys' High School. He
  learnt farming at Te Aute with his Uncle Allen. In 1905 he bought part of "Wairakaia"
  station at Muriwai, Gisborne which he called "Sherwood". Until his retirement in 1950 he
  farmed in partnership with his brother, Claud who owned the adjoining property, "Coventry".
  Carl served as a Lieutenant in the New Zealand Rifle Brigade in France in WW1 and was wounded in action. He
  had a particular interest in the planting and propagation of trees.
  01> WILLIAMS, Elisabeth Carleton m on 11.06.1938 to BUNNY, Ralph
  b 19.02.1912 d 27.06.1996
  b 14.03.1913
  Elisabeth b, and m. at Gisborne. Ralph, s/o Edward William Bunny and Aileen Madelein
  Riddiford, b. at Masterton. Address: 77 Titoki Street, Masterton.
  Elisabeth was educated at Marsden Collegiate School, Karori and was a Karitane nurse
  before marriage and later involved with CAB and meals on wheels. She was a long-serving
  member of the Save the Children Fund Committee in Masterton, Ralph is a retired farmer,
  He served as a Lieutenant in the 3rd Div Pacific from 1942 to 1944.
  01> BUNNY, Jillian Mary m on 01.12.1962 to (1) BARTON, Richard Hugh
  b 14.02.1940
  b 21.11.1939
  Jill b, and educated at Masterton. Divorced.
  01> BARTON, Richard Mark m on 31.10.1992 to CROWL, Julia Mary
  b 29.08.1964
  b 09.03.1964
  Address: 1 Yathong Street, Wagga Wagga 2650, NSW, Australia.
